import React from 'react';

function UsersTable({ users }) {
    return (
        <table>
            <thead>
            <tr>
                <th>Фото</th>
                <th>Name</th>
                <th>Возраст</th>
            </tr>
            </thead>
            <tbody>
            {users.map((user, index) => (
                <tr key={user.id || index}>
                    <td><img src={user.photo} alt={user.name} /></td>
                    <td>{user.name}</td>
                    <td>{user.age}</td>
                </tr>
            ))}
            </tbody>
        </table>
    );
}

export default UsersTable;
